import React, { Component } from 'react'
import { Text, View, StyleSheet } from 'react-native'
import base64 from 'compact-base64';


class JamComponent extends Component {

	render() {

		console.log("editor");
		console.log(this.props.editor);
		console.log(this.props);

		if (this.props.editor) {
			return (
				<View
				  style={styles.wrapper}
				>
					<img
					  width="100%"
					  height="600"
					  src="data:image/png;base64," alt="" />
				</View>
			)
		} else {
			this.frameHash = base64.encodeUrl(JSON.stringify({
				"room": {
					"stageOnly": (this.props.stageOnly ? true : false)
				},
				"ux": {
					"autoCreate": "true"
				},
				"identity": {
					"name": this.props.identity?.displayName,
					"avatar": this.props.identity?.avatar?.uri
				}
			}));
		}
		return (
			<View
			  style={styles.wrapper}
			>
				<iframe
				  src={`https://${this.props.advanced?.jamHost || "jam.systems"}/${this.props.roomId}#${this.frameHash}`}
				  width="100%"
				  allow="microphone *;"
				  style={{border: 0,
					      height: 600}}
				  >
				</iframe>
			</View>
		)
	}
}

const styles = StyleSheet.create({
	wrapper: {
		display: 'flex',
		alignItems: 'center',
		justifyContent: 'center',
	}
})

export default JamComponent
